The core of our rollback system is the ability to capture and restore game state snapshots: /// Resource for tracking game state history
#[derive(Resource)]
pub struct StateHistory { /// Timestamped state snapshots pub snapshots: Vec<StateSnapshot>, /// Maximum number of snapshots to retain pub max_snapshots: usize, /// Time between state snapshots (in seconds) pub snapshot_interval: f32, /// Last snapshot time pub last_snapshot_time: f32,
} impl Default for StateHistory { fn default() -> Self { Self { snapshots: Vec::new(), max_snapshots: 20, // Store up to 20 snapshots (~1 minute of gameplay at 3s intervals) snapshot_interval: 3.0, // Take a snapshot every 3 seconds last_snapshot_time: 0.0, } }
} /// A complete snapshot of game state at a point in time
#[derive(Clone, Debug)]
pub struct StateSnapshot { /// Timestamp when this snapshot was created pub timestamp: f32, /// Unique sequence number pub sequence_id: u64, /// Serialized game state pub game_state: Vec<u8>, /// Serialized RNG state pub rng_state: Vec<u8>, /// Action sequence that led to this state pub action_sequence: Vec<ActionRecord>,
} Creating Snapshots /// System to periodically create game state snapshots
pub fn create_state_snapshots( mut state_history: ResMut<StateHistory>, game_state: Res<GameState>, global_rng: Res<GlobalEntropy<WyRand>>, time: Res<Time>, sequence_tracker: Res<ActionSequence>,
) { // Check if it's time for a new snapshot if time.elapsed_seconds() - state_history.last_snapshot_time >= state_history.snapshot_interval { // Create new snapshot let snapshot = StateSnapshot { timestamp: time.elapsed_seconds(), sequence_id: sequence_tracker.current_sequence_id, game_state: serialize_game_state(&game_state), rng_state: global_rng.try_serialize_state().unwrap_or_default(), action_sequence: sequence_tracker.recent_actions.clone(), }; // Add to history state_history.snapshots.push(snapshot); state_history.last_snapshot_time = time.elapsed_seconds(); // Trim history if needed if state_history.snapshots.len() > state_history.max_snapshots { state_history.snapshots.remove(0); } }
}

