To ensure consistent rollback behavior, all game actions must be deterministic and replayable: /// Record of a game action for replay purposes
#[derive(Clone, Debug, Serialize, Deserialize)]
pub struct ActionRecord { /// Unique sequence ID for this action pub sequence_id: u64, /// Player who initiated the action pub player_id: Entity, /// Timestamp when the action occurred pub timestamp: f32, /// The actual action pub action: GameAction,
} /// System to replay actions after a rollback
pub fn replay_actions( mut commands: Commands, mut game_state: ResMut<GameState>, mut global_rng: ResMut<GlobalEntropy<WyRand>>, rollback_event: Res<RollbackEvent>, actions: Vec<ActionRecord>,
) { // Restore the game state and RNG to the rollback point deserialize_game_state(&mut game_state, &rollback_event.snapshot.game_state); global_rng.deserialize_state(&rollback_event.snapshot.rng_state).expect("Failed to restore RNG state"); // Replay all actions that occurred after the rollback point for action in actions { // Process each action in sequence apply_action(&mut commands, &mut game_state, &mut global_rng, action); }
}

