#[derive(Resource)]
pub struct RngSnapshotHistory { /// History of RNG states indexed by sequence ID pub snapshots: HashMap<u64, Vec<u8>>, /// Maximum number of RNG snapshots to keep pub max_snapshots: usize,
} impl Default for RngSnapshotHistory { fn default() -> Self { Self { snapshots: HashMap::new(), max_snapshots: 100, } }
} /// System to capture RNG state before randomized actions
pub fn capture_rng_before_randomized_action( sequence_tracker: Res<ActionSequence>, global_rng: Res<GlobalEntropy<WyRand>>, mut rng_history: ResMut<RngSnapshotHistory>,
) { // Save the current RNG state before a randomized action if let Some(serialized_state) = global_rng.try_serialize_state() { rng_history.snapshots.insert(sequence_tracker.current_sequence_id, serialized_state); // Clean up old snapshots if needed if rng_history.snapshots.len() > rng_history.max_snapshots { // Find and remove oldest snapshot if let Some(oldest_key) = rng_history.snapshots.keys() .min() .copied() { rng_history.snapshots.remove(&oldest_key); } } }
}

