) { for event in server_events.read() { if let ServerEvent::ClientConnected { client_id } = event { // Check if this is a reconnection if let Some(player_entity) = server.client_player_map.get(client_id) { // Find last known state for this client if let Some(last_known_sequence) = client_states.get_last_sequence(*client_id) { // Find appropriate snapshot to roll back to if let Some(snapshot) = find_appropriate_snapshot(&state_history, last_known_sequence) { // Trigger rollback just for this client rollback_events.send(RollbackEvent { snapshot: snapshot.clone(), reason: RollbackReason::ClientReconnection, affected_clients: vec![*client_id], }); } } } } }
