Complete Rollback Process This example shows a complete rollback process after detecting a state divergence: /// System to detect and handle state divergences
pub fn detect_state_divergences( mut commands: Commands, mut state_checksums: EventReader<StateChecksumEvent>, state_history: Res<StateHistory>, server: Option<Res<GameServer>>, mut rollback_events: EventWriter<RollbackEvent>,
) { // Only run on server if server.is_none() { return; } for checksum_event in state_checksums.read() { // Compare client checksum with server's expected checksum if checksum_event.client_checksum != checksum_event.expected_checksum { info!("State divergence detected for client {:?} at sequence {}", checksum_event.client_id, checksum_event.sequence_id); // Find appropriate snapshot to roll back to if let Some(snapshot) = find_rollback_snapshot(&state_history, checksum_event.sequence_id) { // Trigger rollback for the affected client rollback_events.send(RollbackEvent { snapshot: snapshot.clone(), reason: RollbackReason::StateDivergence, affected_clients: vec![checksum_event.client_id], }); // Log the rollback event info!("Initiating rollback to sequence {} for client {:?}", snapshot.sequence_id, checksum_event.client_id); } } }
} /// Find an appropriate snapshot for rollback
fn find_rollback_snapshot(history: &StateHistory, divergence_sequence: u64) -> Option<&StateSnapshot> { // Find the most recent snapshot before the divergence history.snapshots .iter() .rev() .find(|snapshot| snapshot.sequence_id < divergence_sequence)
} /// Apply a rollback
pub fn apply_rollback( mut commands: Commands, mut game_state: ResMut<GameState>, mut global_rng: ResMut<GlobalEntropy<WyRand>>, mut rollback_events: EventReader<RollbackEvent>, action_history: Res<ActionHistory>,
) { for event in rollback_events.read() { // 1. Restore game state from snapshot deserialize_game_state(&mut game_state, &event.snapshot.game_state); // 2. Restore RNG state global_rng.deserialize_state(&event.snapshot.rng_state) .expect("Failed to restore RNG state"); // 3. Find actions that need to be replayed let actions_to_replay = action_history.get_actions_after(event.snapshot.sequence_id); // 4. Replay actions for action in actions_to_replay { apply_action(&mut commands, &mut game_state, &mut global_rng, action.clone()); } // 5. Notify clients of the rollback for client_id in &event.affected_clients { commands.add(SendRollbackNotification { client_id: *client_id, snapshot: event.snapshot.clone(), reason: event.reason, }); } }
} Handling Randomized Actions During Rollback Special consideration for randomized actions like card shuffling: /// Apply an action during rollback replay
fn apply_action( commands: &mut Commands, game_state: &mut GameState, global_rng: &mut GlobalEntropy<WyRand>, action: ActionRecord,
) { match &action.action { GameAction::ShuffleLibrary { player, library } => { // For randomized actions, we need to ensure deterministic outcomes if let Ok(mut player_rng) = players.get_mut(action.player_id) { // Important: Use the RNG in a consistent way let mut library_entity = *library; let mut library_comp = game_state.get_library_mut(library_entity); // Deterministic shuffle using the player's RNG component library_comp.shuffle_with_rng(&mut player_rng.rng); } }, GameAction::FlipCoin { player } => { // Another example of randomized action if let Ok(mut player_rng) = players.get_mut(action.player_id) { // The random result will be the same as the original action // if the RNG state is properly restored let result = player_rng.rng.gen_bool(0.5); // Apply the result game_state.record_coin_flip(*player, result); } }, // Handle other action types _ => { // Apply non-randomized actions normally game_state.apply_action(&action.action); } }
}

