Server-Side Systems /// Plugin that integrates bevy_replicon with our RNG and rollback systems
pub struct RepliconRngRollbackPlugin; impl Plugin for RepliconRngRollbackPlugin { fn build(&self, app: &mut App) { // Register network channel app.register_network_channel::<RngSyncChannel>(ChannelConfig { channel_id: 100, // Use a unique channel ID mode: ChannelMode::Unreliable, }); // Add resources app.init_resource::<RngReplicationState>() .init_resource::<RollbackCheckpoints>(); // Server systems app.add_systems(Update, ( capture_rng_state, replicate_rng_state, create_rollback_checkpoints, ).run_if(resource_exists::<RepliconServer>())); // Client systems app.add_systems(Update, ( apply_rng_state_updates, handle_rollback_requests, ).run_if(resource_exists::<RepliconClient>())); }
} /// System to capture RNG state for replication
pub fn capture_rng_state( mut global_rng: ResMut<GlobalEntropy<WyRand>>, player_rngs: Query<(Entity, &PlayerRng)>, mut rng_state: ResMut<RngReplicationState>, time: Res<Time>, sequence: Res<SequenceTracker>,
) { // Don't update too frequently if time.elapsed_seconds() - rng_state.last_update < 1.0 { return; } // Capture global RNG state if let Some(state) = global_rng.try_serialize_state() { rng_state.global_state = state; rng_state.dirty = true; } // Capture player RNG states for (entity, _) in player_rngs.iter() { if let Some(player_rng) = player_rngs.get_component::<Entropy<WyRand>>(entity).ok() { if let Some(state) = player_rng.try_serialize_state() { rng_state.player_states.insert(entity, state); rng_state.dirty = true; } } } if rng_state.dirty { rng_state.sequence = sequence.current_sequence; rng_state.last_update = time.elapsed_seconds(); }
} /// System to replicate RNG state to clients
pub fn replicate_rng_state( mut server: ResMut<RepliconServer>, rng_state: Res<RngReplicationState>,
) { if rng_state.dirty { server.broadcast_rng_state(&rng_state); }
} /// System to create rollback checkpoints
pub fn create_rollback_checkpoints( mut checkpoints: ResMut<RollbackCheckpoints>, rng_state: Res<RngReplicationState>, time: Res<Time>, replicated_query: Query<Entity, With<Replication>>, entity_data: Res<EntityData>,
) { // Create a new checkpoint every few seconds if time.elapsed_seconds() % 5.0 < 0.1 { // Collect replicated entity data let mut entities = Vec::new(); for entity in replicated_query.iter() { if let Some(data) = entity_data.get_entity_data(entity) { entities.push(data.clone()); } } // Create checkpoint let checkpoint = RollbackCheckpoint { sequence_id: rng_state.sequence, timestamp: time.elapsed_seconds(), global_rng_state: rng_state.global_state.clone(), player_rng_states: rng_state.player_states.clone(), replicated_entities: entities, }; // Add to checkpoints checkpoints.checkpoints.insert(rng_state.sequence, checkpoint); // Prune old checkpoints while checkpoints.checkpoints.len() > checkpoints.max_checkpoints { if let Some((&oldest_key, _)) = checkpoints.checkpoints.iter().next() { checkpoints.checkpoints.remove(&oldest_key); } } }
} Client-Side Systems /// System to apply RNG state updates from server
pub fn apply_rng_state_updates( mut client: ResMut<RepliconClient>, mut global_rng: ResMut<GlobalEntropy<WyRand>>, mut player_rngs: Query<(Entity, &mut PlayerRng)>, mut events: EventReader<NetworkEvent>,
) { for event in events.read() { if let NetworkEvent::Message(_, RngSyncChannel, data) = event { // Deserialize the RNG state message if let Ok(message) = bincode::deserialize::<RngStateMessage>(data) { // Apply global RNG state if !message.global_state.is_empty() { global_rng.deserialize_state(&message.global_state) .expect("Failed to deserialize global RNG state"); } // Apply player-specific RNG states for (entity, mut player_rng) in player_rngs.iter_mut() { if let Some(state) = message.player_states.get(&entity) { if let Some(rng) = player_rngs.get_component_mut::<Entropy<WyRand>>(entity).ok() { rng.deserialize_state(state).expect("Failed to deserialize player RNG state"); player_rng.sequence = message.sequence; } } } } } }
} /// System to handle rollback requests
pub fn handle_rollback_requests( mut client: ResMut<RepliconClient>, mut global_rng: ResMut<GlobalEntropy<WyRand>>, mut player_rngs: Query<(Entity, &mut PlayerRng)>, mut events: EventReader<NetworkEvent>, mut commands: Commands,
) { for event in events.read() { if let NetworkEvent::Message(_, RollbackChannel, data) = event { // Deserialize the rollback message if let Ok(message) = bincode::deserialize::<RollbackMessage>(data) { // Apply global RNG state from the checkpoint if !message.checkpoint.global_rng_state.is_empty() { global_rng.deserialize_state(&message.checkpoint.global_rng_state) .expect("Failed to deserialize checkpoint RNG state"); } // Apply player-specific RNG states from the checkpoint for (entity, mut player_rng) in player_rngs.iter_mut() { if let Some(state) = message.checkpoint.player_rng_states.get(&entity) { if let Some(rng) = player_rngs.get_component_mut::<Entropy<WyRand>>(entity).ok() { rng.deserialize_state(state).expect("Failed to deserialize player RNG state"); player_rng.sequence = message.checkpoint.sequence_id; } } } // Restore entity state from checkpoint for entity_data in &message.checkpoint.replicated_entities { // Restore entity or spawn if it doesn't exist // ... } info!("Applied rollback to sequence {}", message.checkpoint.sequence_id); } } }
}

