Example 1: Rollback After Network Interruption /// System to detect and handle network interruptions
pub fn handle_network_interruption( mut server: ResMut<RepliconServer>, checkpoints: Res<RollbackCheckpoints>, clients: Query<(Entity, &ClientConnection)>, time: Res<Time>,
) { // Check for clients with high latency or disconnection for (entity, connection) in clients.iter() { if connection.latency > 1.0 || !connection.connected { // Find most recent valid checkpoint if let Some((_, checkpoint)) = checkpoints.checkpoints.iter().rev().next() { // Initiate rollback for all clients let rollback_message = RollbackMessage { rollback_type: RollbackType::Full, checkpoint: checkpoint.clone(), reason: "Network interruption detected".to_string(), }; // Send to all clients server.broadcast_message(RollbackChannel, bincode::serialize(&rollback_message).unwrap()); // Apply rollback on server too apply_rollback_on_server(&rollback_message); info!("Initiated rollback due to network interruption"); } break; } }
} Example 2: Handling Card Shuffle During Rollback /// System to handle card shuffling during or after a rollback
pub fn handle_shuffle_during_rollback( mut commands: Commands, mut shuffle_events: EventReader<ShuffleLibraryEvent>, mut global_rng: ResMut<GlobalEntropy<WyRand>>, player_rngs: Query<(Entity, &PlayerRng)>, libraries: Query<(Entity, &Library, &Parent)>,
) { for event in shuffle_events.read() { if let Ok((library_entity, library, parent)) = libraries.get(event.library_entity) { // Get the player entity (parent) let player_entity = parent.get(); // Get player's RNG if let Ok((_, player_rng)) = player_rngs.get(player_entity) { // Use the appropriate RNG for deterministic shuffle let mut card_indices: Vec<usize> = (0..library.cards.len()).collect(); if player_rng.is_remote { // Use global RNG for remote player to ensure consistency for i in (1..card_indices.len()).rev() { let j = global_rng.gen_range(0..=i); card_indices.swap(i, j); } } else { // Use player-specific RNG for local player if let Some(rng) = player_rngs.get_component::<Entropy<WyRand>>(player_entity).ok() { for i in (1..card_indices.len()).rev() { let j = rng.gen_range(0..=i); card_indices.swap(i, j); } } } // Apply shuffle result // ... info!("Performed deterministic shuffle during/after rollback"); } } }
}

