} impl RepliconRngTestHarness { /// Create a new test harness with the specified number of clients pub fn new(num_clients: usize) -> Self { let mut server_app = App::new(); let mut client_apps = Vec::with_capacity(num_clients); // Setup server server_app.add_plugins(MinimalPlugins) .add_plugins(DefaultRngPlugin) .add_plugins(RepliconServerPlugin::default()) .add_plugin(RepliconRngRollbackPlugin); // Setup RNG with specific seed for repeatability let test_seed = 12345u64; server_app.world.resource_mut::<GlobalEntropy<WyRand>>().seed_from_u64(test_seed); // Setup clients for _ in 0..num_clients { let mut client_app = App::new(); client_app.add_plugins(MinimalPlugins) .add_plugins(DefaultRngPlugin) .add_plugins(RepliconClientPlugin::default()) .add_plugin(RepliconRngRollbackPlugin); // Each client gets the same seed client_app.world.resource_mut::<GlobalEntropy<WyRand>>().seed_from_u64(test_seed); client_apps.push(client_app); } Self { server_app, client_apps, network_conditions: NetworkConditionSimulator::default(), test_seed, } } /// Connect all clients to the server pub fn connect_all_clients(&mut self) { // Setup server to listen let server_port = 8080; self.server_app.world.resource_mut::<RepliconServer>() .start_endpoint(ServerEndpoint::new(server_port)); // Connect clients for (i, client_app) in self.client_apps.iter_mut().enumerate() { client_app.world.resource_mut::<RepliconClient>() .connect_endpoint(ClientEndpoint::new("127.0.0.1", server_port)); } // Update a few times to establish connections for _ in 0..10 { self.server_app.update(); for client_app in &mut self.client_apps { client_app.update(); } } } /// Simulate network disruption for a specific client pub fn simulate_disruption(&mut self, client_idx: usize, duration_ms: u64) { self.network_conditions.disconnect_client(client_idx, duration_ms); } /// Run a test with network conditions pub fn run_with_conditions<F>(&mut self, update_count: usize, test_fn: F) where F: Fn(&mut Self, usize) { for i in 0..update_count { // Apply network conditions self.network_conditions.update(&mut self.client_apps); // Run server update self.server_app.update(); // Run client updates for client_app in &mut self.client_apps { client_app.update(); } // Call test function test_fn(self, i); } }
} /// Simulates different network conditions
pub struct NetworkConditionSimulator { /// Client disconnection timers pub disconnection_timers: HashMap<usize, u64>, /// Packet loss percentages pub packet_loss_rates: HashMap<usize, f32>, /// Latency values pub latencies: HashMap<usize, u64>,
} impl NetworkConditionSimulator { /// Disconnect a client for a duration pub fn disconnect_client(&mut self, client_idx: usize, duration_ms: u64) { self.disconnection_timers.insert(client_idx, duration_ms); } /// Apply network conditions to clients pub fn update(&mut self, client_apps: &mut [App]) { // Update disconnection timers and reconnect if needed let mut reconnect = Vec::new(); for (client_idx, timer) in &mut self.disconnection_timers { if *timer <= 16 { reconnect.push(*client_idx); } else { *timer -= 16; // Assuming 60 FPS } } for client_idx in reconnect { self.disconnection_timers.remove(&client_idx); } }
}

