fn test_rng_state_serialization() { // Create a test app let mut app = App::new(); app.add_plugins(MinimalPlugins) .add_plugins(DefaultRngPlugin) .init_resource::<RngReplicationState>(); // Setup global RNG with specific seed let test_seed = 12345u64; app.world.resource_mut::<GlobalEntropy<WyRand>>().seed_from_u64(test_seed); // Generate some random values and store them let original_values: Vec<u32> = { let mut rng = app.world.resource_mut::<GlobalEntropy<WyRand>>(); (0..10).map(|_| rng.gen::<u32>()).collect() }; // Capture the RNG state let mut rng_state = app.world.resource_mut::<RngReplicationState>(); let global_rng = app.world.resource::<GlobalEntropy<WyRand>>(); rng_state.global_state = global_rng.try_serialize_state().unwrap(); // Create a new app with fresh RNG let mut new_app = App::new(); new_app.add_plugins(MinimalPlugins) .add_plugins(DefaultRngPlugin); // Apply the saved state let mut new_global_rng = new_app.world.resource_mut::<GlobalEntropy<WyRand>>(); new_global_rng.deserialize_state(&rng_state.global_state).unwrap(); // Generate values from the new RNG let new_values: Vec<u32> = { let mut rng = new_app.world.resource_mut::<GlobalEntropy<WyRand>>(); (0..10).map(|_| rng.gen::<u32>()).collect() }; // Values should be different from the original sequence // because we captured the state after generating the original values assert_ne!(original_values, new_values); // Reset both RNGs to the same seed and generate sequences app.world.resource_mut::<GlobalEntropy<WyRand>>().seed_from_u64(test_seed); new_app.world.resource_mut::<GlobalEntropy<WyRand>>().seed_from_u64(test_seed); let reset_values1: Vec<u32> = { let mut rng = app.world.resource_mut::<GlobalEntropy<WyRand>>(); (0..10).map(|_| rng.gen::<u32>()).collect() }; let reset_values2: Vec<u32> = { let mut rng = new_app.world.resource_mut::<GlobalEntropy<WyRand>>(); (0..10).map(|_| rng.gen::<u32>()).collect() }; // Values should now be identical assert_eq!(reset_values1, reset_values2);
} Testing Checkpoint Creation and Restoration #[test]
fn test_checkpoint_creation_and_restoration() { // Create a test app with the plugin let mut app = App::new(); app.add_plugins(MinimalPlugins) .add_plugins(DefaultRngPlugin) .add_plugin(RepliconRngRollbackPlugin) .init_resource::<SequenceTracker>(); // Seed RNG let test_seed = 12345u64; app.world.resource_mut::<GlobalEntropy<WyRand>>().seed_from_u64(test_seed); // Generate some initial values let initial_values: Vec<u32> = { let mut rng = app.world.resource_mut::<GlobalEntropy<WyRand>>(); (0..5).map(|_| rng.gen::<u32>()).collect() }; // Create a checkpoint let checkpoint_sequence = 1; let mut checkpoints = app.world.resource_mut::<RollbackCheckpoints>(); let rng_state = app.world.resource::<RngReplicationState>(); let global_rng = app.world.resource::<GlobalEntropy<WyRand>>(); let checkpoint = RollbackCheckpoint { sequence_id: checkpoint_sequence, timestamp: 0.0, global_rng_state: global_rng.try_serialize_state().unwrap(), player_rng_states: HashMap::new(), replicated_entities: Vec::new(), }; checkpoints.checkpoints.insert(checkpoint_sequence, checkpoint); // Generate more values after checkpoint let post_checkpoint_values: Vec<u32> = { let mut rng = app.world.resource_mut::<GlobalEntropy<WyRand>>(); (0..5).map(|_| rng.gen::<u32>()).collect() }; // Restore from checkpoint let checkpoint = checkpoints.checkpoints.get(&checkpoint_sequence).unwrap(); app.world.resource_mut::<GlobalEntropy<WyRand>>() .deserialize_state(&checkpoint.global_rng_state).unwrap(); // Generate values after restoration let restored_values: Vec<u32> = { let mut rng = app.world.resource_mut::<GlobalEntropy<WyRand>>(); (0..5).map(|_| rng.gen::<u32>()).collect() }; // The restored values should match the post-checkpoint values assert_eq!(post_checkpoint_values, restored_values);
}

