fn test_rollback_after_disruption() { // Create test harness with 2 clients let mut harness = RepliconRngTestHarness::new(2); harness.connect_all_clients(); // Setup game entities // ... // Run test with network disruption let mut pre_disruption_rng_values = Vec::new(); let mut post_disruption_rng_values = Vec::new(); let mut post_rollback_rng_values = Vec::new(); harness.run_with_conditions(100, |harness, i| { if i == 20 { // Record RNG values before disruption let rng = harness.server_app.world.resource::<GlobalEntropy<WyRand>>(); pre_disruption_rng_values = generate_test_random_values(rng, 10); // Simulate network disruption for client 0 harness.simulate_disruption(0, 500); // 500ms disruption } if i == 40 { // Record RNG values after disruption let rng = harness.server_app.world.resource::<GlobalEntropy<WyRand>>(); post_disruption_rng_values = generate_test_random_values(rng, 10); } if i == 60 { // By now rollback should have happened // Record RNG values after rollback let rng = harness.server_app.world.resource::<GlobalEntropy<WyRand>>(); post_rollback_rng_values = generate_test_random_values(rng, 10); // Check that client 0 and client 1 have the same RNG state let rng0 = harness.client_apps[0].world.resource::<GlobalEntropy<WyRand>>(); let rng1 = harness.client_apps[1].world.resource::<GlobalEntropy<WyRand>>(); let client0_values = generate_test_random_values(rng0, 10); let client1_values = generate_test_random_values(rng1, 10); assert_eq!(client0_values, client1_values, "Clients should have same RNG state after rollback"); } }); // Verify behavior assert_ne!(pre_disruption_rng_values, post_disruption_rng_values, "RNG values should change during normal operation"); assert_eq!(post_rollback_rng_values, post_disruption_rng_values, "After rollback, RNG sequences should match the checkpoint state");
} /// Helper function to generate random values for testing
fn generate_test_random_values(rng: &GlobalEntropy<WyRand>, count: usize) -> Vec<u32> { let mut rng_clone = rng.clone(); (0..count).map(|_| rng_clone.gen::<u32>()).collect()
}

