Testing RNG State Replication Bandwidth #[test]
fn test_rng_replication_bandwidth() { // Create a test harness with multiple clients let mut harness = RepliconRngTestHarness::new(4); harness.connect_all_clients(); // Setup bandwidth tracking let mut bandwidth_tracker = BandwidthTracker::new(); // Run test with bandwidth monitoring harness.run_with_conditions(100, |harness, i| { if i % 10 == 0 { // Record bandwidth usage every 10 updates let server = harness.server_app.world.resource::<RepliconServer>(); bandwidth_tracker.record_bandwidth(server.get_bandwidth_stats()); } }); // Analyze bandwidth results let results = bandwidth_tracker.analyze(); // Ensure RNG state replication is within reasonable bounds assert!(results.avg_bandwidth_per_client < 1024, "Average bandwidth should be less than 1KB per client"); // Print results println!("Bandwidth results:"); println!(" Average per client: {} bytes", results.avg_bandwidth_per_client); println!(" Peak: {} bytes", results.peak_bandwidth); println!(" Total: {} bytes", results.total_bandwidth);
} /// Helper struct for tracking bandwidth usage
struct BandwidthTracker { samples: Vec<BandwidthSample>,
} struct BandwidthSample { timestamp: f32, bytes_sent: usize, client_count: usize,
} struct BandwidthResults { avg_bandwidth_per_client: f32, peak_bandwidth: usize, total_bandwidth: usize,
} impl BandwidthTracker { fn new() -> Self { Self { samples: Vec::new() } } fn record_bandwidth(&mut self, stats: BandwidthStats) { self.samples.push(BandwidthSample { timestamp: stats.timestamp, bytes_sent: stats.bytes_sent, client_count: stats.client_count, }); } fn analyze(&self) -> BandwidthResults { if self.samples.is_empty() { return BandwidthResults { avg_bandwidth_per_client: 0.0, peak_bandwidth: 0, total_bandwidth: 0, }; } let total_bytes: usize = self.samples.iter().map(|s| s.bytes_sent).sum(); let peak_bytes = self.samples.iter().map(|s| s.bytes_sent).max().unwrap_or(0); let client_samples: usize = self.samples.iter().map(|s| s.client_count).sum(); let avg_per_client = if client_samples > 0 { total_bytes as f32 / client_samples as f32 } else { 0.0 }; BandwidthResults { avg_bandwidth_per_client: avg_per_client, peak_bandwidth: peak_bytes, total_bandwidth: total_bytes, } }
} /// Mock struct to represent network bandwidth statistics
struct BandwidthStats { timestamp: f32, bytes_sent: usize, client_count: usize,
}

