The Rummage game UI is built using Bevy's Entity Component System (ECS) architecture, with a clear separation of concerns between game logic and visual presentation. The UI follows a layered approach to ensure clean organization, efficient rendering, and maintainable code. Key Components The UI system uses non-deprecated Bevy 0.15.x components: Node for layout containers (replacing deprecated NodeBundle) Text2d for text display (replacing deprecated Text2dBundle) Sprite for images (replacing deprecated SpriteBundle) Button for interactive elements RenderLayers for visibility control Layers The UI architecture is organized into distinct render layers as defined in src/camera/components.rs: #[derive(Debug, Clone, Copy, Default, PartialEq, Eq, Hash)]
pub enum AppLayer { #[default] Shared, // Layer 0: Shared elements visible to all cameras Background, // Layer 1: Game background elements GameWorld, // Layer 2: Game world elements Cards, // Layer 3: Card entities GameUI, // Layer 4: In-game UI elements Effects, // Layer 5: Visual effects Overlay, // Layer 6: Game overlays Menu, // Layer 7: Menu elements Popup, // Layer 8: Popup dialogs Debug, // Layer 9: Debug visuals DebugText, // Layer 10: Debug text DebugGizmo, // Layer 11: Debug gizmos Wireframe, // Layer 12: Wireframe visualization Game = 31, // Layer 31: Legacy game layer (backward compatibility)
} These layers enable precise control over which UI elements are visible in different game states.

