) -> Entity { // Default profile image let profile_image = player.profile_image.clone() .unwrap_or_else(|| asset_server.load("textures/avatars/default.png")); commands .spawn(( PlayerAvatar { player_id: player.id, display_name: player.name.clone(), profile_image: profile_image.clone(), border_style: AvatarBorderStyle::default(), customization_settings: player.avatar_customization.clone(), }, Node { width: Val::Px(280.0), height: Val::Px(80.0), flex_direction: FlexDirection::Row, padding: UiRect::all(Val::Px(5.0)), ..default() }, BackgroundColor(Color::rgba(0.1, 0.1, 0.1, 0.8)), BorderColor(Color::rgb(0.6, 0.6, 0.6)), Outline::new(Val::Px(1.0)), Transform::from_translation(Vec3::new(position.x, position.y, 0.0)), GlobalTransform::default(), AppLayer::GameUI.layer(), )) .with_children(|parent| { // Profile image container parent .spawn(Node { width: Val::Px(70.0), height: Val::Px(70.0), margin: UiRect::right(Val::Px(10.0)), ..default() }) .with_children(|image_container| { // Profile image image_container.spawn(( Sprite { custom_size: Some(Vec2::new(70.0, 70.0)), ..default() }, profile_image, )); }); // Information container parent .spawn(Node { width: Val::Percent(100.0), height: Val::Percent(100.0), flex_direction: FlexDirection::Column, justify_content: JustifyContent::SpaceBetween, ..default() }) .with_children(|info| { // Username info.spawn(( Text2d { text: player.name.clone(), font_size: 18.0, color: Color::WHITE, }, )); // Life counter info.spawn(( Text2d { text: format!("Life: {}", player.life), font_size: 16.0, color: Color::rgb(0.8, 0.8, 0.8), }, AvatarLifeCounter { player_id: player.id, current_life: player.life, previous_life: player.life, animation_timer: Timer::from_seconds(0.5, TimerMode::Once), is_animating: false, }, )); // Priority indicator (hidden by default) info.spawn(( Text2d { text: "‚ö° Priority".to_string(), font_size: 16.0, color: Color::YELLOW, }, PriorityIndicator { player_id: player.id, visible: false }, Visibility::Hidden, )); }); }) .id()
} Life Total Update System fn update_avatar_life_counters( time: Res<Time>, mut life_counter_query: Query<(&mut AvatarLifeCounter, &mut Text2d)>, player_query: Query<(&Player, &PlayerId)>,
) { for (player, player_id) in player_query.iter() { for (mut life_counter, mut text) in life_counter_query.iter_mut() { if life_counter.player_id == *player_id { // Check if life has changed if player.life != life_counter.current_life { // Update previous life for animation life_counter.previous_life = life_counter.current_life; life_counter.current_life = player.life; life_counter.is_animating = true; life_counter.animation_timer.reset(); } // Update text display if life_counter.is_animating { life_counter.animation_timer.tick(time.delta()); // Determine color based on life change let life_change = life_counter.current_life - life_counter.previous_life; let color = if life_change > 0 { Color::GREEN } else if life_change < 0 { Color::RED } else { Color::WHITE }; // Format text with change indicator let change_text = if life_change > 0 { format!("‚ñ≤{}", life_change) } else if life_change < 0 { format!("‚ñº{}", life_change.abs()) } else { String::new() }; text.text = format!("Life: {} {}", life_counter.current_life, change_text); text.color = color; // End animation after timer completes if life_counter.animation_timer.finished() { life_counter.is_animating = false; text.color = Color::WHITE; text.text = format!("Life: {}", life_counter.current_life); } } } } }
} Priority Indicator System fn update_priority_indicators( mut priority_query: Query<(&mut Visibility, &PriorityIndicator)>, game_state: Res<GameState>,
) { // Find player with priority let priority_player_id = game_state.priority_player; // Update all priority indicators for (mut visibility, indicator) in priority_query.iter_mut() { if indicator.player_id == priority_player_id { *visibility = Visibility::Visible; } else { *visibility = Visibility::Hidden; } }
}

